import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const elem = {
  type: 'h2',
  props: {
    className: 'greeting',
    children: 'hello za warudo'
  }
};


ReactDOM.render(
  elem,
  document.getElementById('root')
);
